export const COLUMNS = [
    {
        Header: 'Id',
        accessor: 'id'
    },
    {
        Header: 'Name',
        accessor: 'name'
    },
    {
        Header: 'Type',
        accessor: 'type'
    },
    {
        Header: 'Distance',
        accessor: 'distance'
    },
    {
        Header: 'SuitabilityId',
        accessor: 'suitabilityId'
    },
    {
        Header: 'Note',
        accessor: 'note'
    }
]
